import React from 'react';
import "./Home.css";

function Home() {
    return (
        <div className="Page">

            <div className="crop-box">
                <img src="images/Chicago-Night.jpg" alt="Chicago HomePage"/>
            </div>

            <h1 className="HomeTitle">This is the home page</h1>

            <div className="SubHeadingSection">
                <h1 className="Headline">A glimpse into Sugene's world</h1>
                This website will give you details about who Sugene is, what his interests are, and his career history.
                <br /><br /><br />
            </div>
        </div>
    );
}

export default Home;
